import React, { useState } from 'react';
import './Header.css'; // Import the styles for this component

const Header = ({ onSearch }) => {
    const [query, setQuery] = useState('');

    const handleSearch = (e) => {
        e.preventDefault();
        onSearch(query);
    };

    return (
        <div className="header-container">
            <div className="logo-container">
                {/* Replace the src with your own logo URL */}
                <img src="/logo.png" alt="My Logo" className="logo" />
            </div>
            <form className="search-bar-container" onSubmit={handleSearch}>
                <input
                    type="text"
                    placeholder="Search..."
                    value={query}
                    onChange={(e) => setQuery(e.target.value)}
                    className="search-input"
                />
                <button type="submit" className="search-button">
                    Search
                </button>
            </form>
            <div className="options-container">
                <button className="option-button">Settings</button>
                <button className="option-button">Login</button>
            </div>
        </div>
    );
};

export default Header;
